import Particles from "react-particles";

export default function PP(){
    const particleParams = {
        particles: {
          number: {
            value: 100
          },
          color: {
            value: "#ffffff"
          },
          links: {
            enable: true,
            distance: 200
          },
          shape: {
            type: "circle"
          },
          opacity: {
            value: 1
          },
          size: {
            value: {
              min: 4,
              max: 6
            }
          },
          move: {
            enable: true,
            speed: 2
          }
        },
        background: {
          color: "#000000"
        },
        poisson: {
          enable: true
        }
      };



    return(
        <>
        <div className="bg-purple-950 z-0 w-full h-screen ">
            <Particles params={particleParams}
          style={{
            position: 'absolute',
            top: 0,
            left: 0,
            width: '100%',
            height: '100%',



          }}

            />

        </div>


        </>
    )
}
